import { Menu } from 'antd';

export default function Jobs()
{
	return (
		<div className="job-page">
			<Menu style={{margin: 20}}>
				<Menu.SubMenu title="Choose Location">
					<Menu.Item>Abudhabi</Menu.Item>
				</Menu.SubMenu>
			</Menu>
		</div>
	);
};
